class Solution {
public:
    int threeSumSmaller(vector<int>& nums, int target) {
        int n = nums.size();
        if(n<3) return 0;
        sort(nums.begin(), nums.end());
        int ans = 0;
        for(int i=0; i<n-2; i++){
            int l = i+1, r = n-1;
            while(l<r){
                if(nums[i]+nums[l]+nums[r]<target){
                    ans += r-l;
                    l++;
                }
                else r--;
            }
        }
        return ans;
    }
};

