Extract-Response:
 sumMap[sum%k] - 1.

The idea is as follows:

Consider all subarrays ending at j. We know the sum of this subarray is sum[j]. Then, sum[j] = sum[j-1] + A[j]. Thus, sum[j] mod k = (sum[j-1] + A[j]) mod k = (sum[j-1] mod k + A[j] mod k) mod k.

We iterate through all j and keep track of the value of sum[j] mod k and the number of times we have seen this value before. Whenever we see the same value again, we know there are at least two subarrays (one ending at j-1 and one ending at j) with that particular value of sum[j] mod k.

We can use a hashmap to keep track of the values of sum[j] mod k and the number of times we have seen that value before.

For example, if the input is A = [4,5,0,-2,-3,1], k = 5, we would have the following map entries (in chronological order):

sum[j] mod k	Number of times seen before
4	1
9	2
4	3
2	4
1	5

Thus, there are 4 subarrays with sum[j] mod k = 4.

We can use the Pigeonhole Principle to improve this to O(N) time.

Consider the sequence of values of sum[j] mod k as we iterate through j. There are k possible values that this sequence can take on (namely, 0,1,...,k-1). Thus, if we ever encounter the same value twice, we know that there must be at least two subarrays with a given value of sum[j] mod k.

We can use this idea to eliminate the hashmap. We will maintain a count of the number of times we have seen each of the k values modulo k. Whenever we reach a sum[j] mod k that we have seen before, we know there must be at least one subarray with sum[j] mod k equal to the current value. We can then update our answer by adding the number of times we have seen the current value to our answer.

We can use an array to keep track of the number of times we have seen each of the k values modulo k. This takes up O(k) space, but it improves our time complexity to O(N).

class Solution {
    public int subarraysDivByK(int[] A, int K) {
        int N = A.length;
        int[] P = new int[N+1];
        for (int i = 0; i < N; ++i)
            P[i+1] = P[i] + A[i];

        int[] count = new int[K];
        for (int x: P)
            count[(x % K + K) % K]++;

        int ans = 0;
        for (int v: count)
            ans += v * (v - 1) / 2;
        return ans;
    }
}

Complexity Analysis

Time Complexity: O(N+K)O(N+K), where NN is the length of A.

Space Complexity: O(N+K)O(N+K).

